public class InnerSecurityProfileBehaviorCriteriaFactory(Action<Humidifier.IoT.SecurityProfileTypes.BehaviorCriteria> factoryAction = null) : SubResourceFactory<Humidifier.IoT.SecurityProfileTypes.BehaviorCriteria>
{

    internal InnerSecurityProfileMachineLearningDetectionConfigFactory MlDetectionConfigFactory { get; set; }

    internal InnerSecurityProfileMetricValueFactory ValueFactory { get; set; }

    internal InnerSecurityProfileStatisticalThresholdFactory StatisticalThresholdFactory { get; set; }

    protected override Humidifier.IoT.SecurityProfileTypes.BehaviorCriteria Create()
    {
        var behaviorCriteriaResult = CreateBehaviorCriteria();
        factoryAction?.Invoke(behaviorCriteriaResult);

        return behaviorCriteriaResult;
    }

    private Humidifier.IoT.SecurityProfileTypes.BehaviorCriteria CreateBehaviorCriteria()
    {
        var behaviorCriteriaResult = new Humidifier.IoT.SecurityProfileTypes.BehaviorCriteria();

        return behaviorCriteriaResult;
    }
    public override void CreateChildren(Humidifier.IoT.SecurityProfileTypes.BehaviorCriteria result)
    {
        base.CreateChildren(result);

        result.MlDetectionConfig ??= MlDetectionConfigFactory?.Build();
        result.Value ??= ValueFactory?.Build();
        result.StatisticalThreshold ??= StatisticalThresholdFactory?.Build();
    }

} // End Of Class

